import React, {FC} from 'react';
import Layout from 'components/global/layout';
import './styles.scss';

interface IProps {};

export const Addpost: FC<IProps> = () => (
  <Layout title="Addpost" description="This is the Addpost Page">
   <Addpost />
  </Layout>
);

export default Addpost;
